<ul>
<li>进程是程序的一次执行过程，是一个动态概念，是程序在执行过程中分配和管理资源的基本单位</li>
<li>进程拥有自己独立的内存空间</li>
<li>程序本身只是指令、数据及其组织形式的描述，进程才是程序的真正运行实例</li>
</ul>
